import React, { Component } from 'react';

class List extends Component {
    render() {
        return (
            <div className="listBox">
                <ul>
                    <li>
                        <div className="listImg">
                            <img src="" alt="동영상 이미지"/>
                        </div>
                        <div>
                            <p>
                                동영상 목록
                            </p>
                        </div>
                    </li>
                </ul>
            </div>
        );
    }
}

export default List;
